import React from 'react';

import Button from '../../UserInterface/Buttons/Button/Button'
import ButtonLink from '../../UserInterface/Buttons/Button/ButtonLink'


function ConsoleButton (props){

    return(
        <div>
            <Button 
                    classname = {props.classname}
                    onclick = {props.onclick1}
                    title = {props.title1}
                    type = {props.type}
                    tabindex = {props.tabindex}
                    name = {props.name1} 
                />
            <ButtonLink 
                    to={props.linkWindowEdit}
                    classname={props.classname}
                    onclick = {props.onclick2}
                    title = {props.title2}
                    type = {props.type}
                    tabindex = {props.tabindex}
                    name = {props.name2} 
                />
            <ButtonLink 
                    to={props.linkWindowEdit}
                    classname = {props.classname}
                    onclick = {props.onclick3}
                    title = {props.title3}
                    type = {props.type}
                    tabindex = {props.tabindex}
                    name = {props.name3} 
                />
            <ButtonLink
                    to={props.linkWindowConfirmDeleting}
                    classname = {props.classname}
                    onclick = {props.onclick4}
                    title = {props.title4}
                    type = {props.type}
                    tabindex = {props.tabindex}
                    name = {props.name4} 
                />
            <Button 
                    classname = {props.classname}
                    onclick = {props.onclick5}
                    title = {props.title5}
                    type = {props.type}
                    tabindex = {props.tabindex}
                    name = {props.name5} 
                />
        </div>
    )
}

export default ConsoleButton


